module.exports = JSON.parse('{"DroneProject":{"ProjectTitle":"Object Tracking Drone","PythonTools":"OpenCV, MAVLink","OtherTools":"CNC (G-Code), Solidworks, FEA (Finite Element Analysis), PID, Linux","GithubLink":"https://github.com/rlew631/ObjectTrackingDrone","PopupTextP0":"This project involved building a custom drone and using OpenCV on a Raspberry Pi to perform object tracking."},"CarProject":{"ProjectTitle":"Training Autonomous Vehicles using RL","PythonTools":"FLOW, RLlib, OpenAI Gym, SUMO, OpenStreetMaps, Tensorflow","YoutubeLink":"https://youtu.be/qXuBEs9G7Iw","GithubLink":"https://github.com/rlew631/AutonomousVehicleSimulation","PopupTextP0":"The purpose of this project was to create a model which develops autonomous vehicle driving policies using a deep reinforcement learning policy. See my discussion on youtube or the slide deck in the repo which goes over the general framework and the tools used."},"SpeechProject":{"ProjectTitle":"Spoken Word Classification","PythonTools":"Keras, Numpy, Matplotlib, SciPy, SKImage","GithubLink":"https://github.com/rlew631/SpeechRecognition","PopupTextP0":"This project involved taking a dataset which consisted of 30 different spoken words, batching them and converting them to spectrograms in order to perform classification with a custom CNN."},"DrugProject":{"ProjectTitle":"Predicting Drug Effects from their Chemical Markers","PythonTools":"SKLearn, IMBLearn, MatPlotLib, Plotly, Seaborn","OtherTools":"Heroku, HTML, JavaScript, CSS","GithubLink":"https://github.com/rlew631/DrugMethodsOfAction","WebsiteLink":"https://moa-prediction-app.herokuapp.com/","PopupTextP0":"The purpose of this project was to find a relationship between drug attributes and their corresponding methods of action. This could improve the efficiency of the drug development process by selectively eliminating drug candidates which are likely to have additional unwanted MOAs (mechanisms of action) before moving on to the screening and preclinical trial phases of development."},"PlanktonProject":{"ProjectTitle":"Predicting Zooplankton Presence from Water Quality Data","PythonTools":"SKLearn, Numpy, Pandas, MatPlotLib, Seaborn","GithubLink":"https://github.com/rlew631/SanJoaquinZooplanktonPredictor","PopupTextP0":"The purpose of this project was to predict the presence of aquatic micro-organisms in the San Joaquin Delta based on water quality measurements from USGS. These organisms are a key food source for the endangered Delta Smelt which has experienced a rapid population decline in the last few years."},"NLPProject":{"ProjectTitle":"Comparing Stock Performance to Annual Filings using NLP","PythonTools":"NLTK, BeautifulSoup, Matplotlib, Pandas","GithubLink":"https://github.com/rlew631/NLP_stock_analysis","PopupTextP0":"This project is a continuation of the Lazy Prices paper published by Lauren Cohen of HBS which speculated that a magnitude of changes in the content of a company\'s quarterly filing would indicate that their stock is likely to drop.","PopupTextP1":"My implementation compares the cosine similarity and jaccard score of a given company\'s filing to the one they filed the previous year. Additionally I wrote a custom sentiment index which uses Loughran McDonald\'s financial NLP dictionary to determine the overall sentiment of a given year\'s filing."},"FSAE":{"ProjectTitle":"Formula SAE Race Car","ProjectTools":"FEA (Finite Element Analysis), DFM (Design for Manufacture), Proposal Writing, Leadership/Communication","PopupTextP0":"I initially proposed this project to the head of the engineering department at my college. We worked together to secure grant funding and coordinated a group of students to develop and build a race car for the annual Formula SAE competition in Michigan.","PopupTextP1":"This project required coordinating with various stakeholders in administration at the college as well as developing design and fabrication workshops for the students to successfully participate.","PaperLink":"http://www.laccei.org/LACCEI2019-MontegoBay/student_papers/SP491.pdf","YoutubeLink":"https://www.youtube.com/watch?v=rsLcJnHyiQ4"},"Subaru":{"ProjectTitle":"Modified Subaru Street Car","ProjectTools":"CANBUS Troubleshooting, Engine and ECU Parameter Logging/Modification, CNC Machining/TIG Welding, Digital Signal Analysis","PopupTextP0":"After purchasing a 2008 Subaru WRX in 2013 using bitcoin mined in a college dorm room I have incrementally upgraded all of the major components in the drivetrain, fuel system, suspension and braking systems with parts which were sourced from OEM and aftermarket vendors as well as custom fabricated pieces.","PopupTextP1":"Most recently I finished building and installing a custom spec engine using the OEM EJ255 case halves, EJ207 cylinder heads sourced from Japan and aftermarket internals. This required tight-tolerance CNC machining, electromechanical troubleshooting, custom wiring/electronics installation and realtime tuning of the fuel, ignition, valve timing maps and sensor calibrations for the engine."}}');

